var lcpArray = function(lcp, s, SA, iSA) {
	var n = s.length;

	var l = 0;
	for (var i = 0; i < n; ++i) {
		var k = iSA[i];
		var j = SA[k - 1];

		while (s[i + l] === s[j + l]) {
			l++;
		}

		lcp[k] = l;

		if (l > 0) {
			l--;
		}
	}
}





